INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24001, "アヤネ", 401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 24, 0.0, 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24002, "アヤネ", 402, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 24, 2.21, 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24003, "アヤネ", 403, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 24, 0.0, 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24004, "アサヒ", 701, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 24, 1.99, 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24005, "アサヒ", 702, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 24, 2.21, 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24006, "アサヒ", 703, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 24, 3.33, 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24007, "部員３", 801, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 24, 0.0, 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24008, "部員３", 802, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 24, 2.68, 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24009, "部員３", 803, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 24, 0.0, 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24010, "", 501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "やった！", 1, 24, 0.0, 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24011, "", 502, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "勝ったよ！", 1, 24, 0.0, 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24012, "", 503, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "いい調子！", 1, 24, 0.0, 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24013, "ミサト", 111, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 24, 5.33, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24014, "ミサト", 112, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 24, 6.85, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24015, "ミサト", 113, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 24, 3.0, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24016, "ダイチ", 611, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 24, 6.11, 192401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24017, "ダイチ", 612, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 24, 6.75, 192401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24018, "ダイチ", 613, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 24, 0.0, 192401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24019, "ハツネ", 211, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 24, 4.52, 113401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24020, "ハツネ", 212, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 24, 3.89, 113401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24021, "ハツネ", 213, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 24, 13.49, 113401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24022, "カヤ", 311, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 24, 3.17, 106501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24023, "カヤ", 312, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 24, 4.42, 106501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24024, "カヤ", 313, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 24, 2.89, 106501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24025, "アヤネ", 421, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 10046, 0.0, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 24, 3.71, 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24026, "アサヒ", 721, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 24, 5.1, 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24027, "部員３", 821, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 10046, 0.0, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 24, 4.34, 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24028, "", 521, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 0.0, "いい勝負だったよ\nまたやろうね", 1, 24, 0.0, 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24029, "ミサト", 101, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 24, 5.62, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24030, "ミサト", 102, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 24, 9.58, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24031, "ミサト", 103, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 24, 0.0, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24032, "ミサト", 104, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 24, 9.13, 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24033, "ミサト", 105, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 24, 8.27, 113501);
